import React from 'react';
import classes from "./Tabs.module.css";

const Tabs = () => {
    return (
        <div className={classes.container}>
            <div className={classes.group_items}>
                <div className={classes.item}>О товаре</div>
                <div className={classes.item}>Правила</div>
                <div className={classes.item}>Отзывы (10)</div>
                <div className={classes.item}>Наличие и доставка</div>
            </div>
        </div>
    );
};

export default Tabs;
